import React, { useState } from "react";
import { Pie } from "react-chartjs-2";
import axios from "axios";

const Claim = () => {
  // const [selectDedommage, setSelectDedommage] = useState(0);
  // const [selectIndemnises, setSetectIndemnises] = useState(0);

  const data2 = {
    labels: ["Dedommage", "Indemnises"],
    datasets: [
      {
        data: [2, 5],
        backgroundColor: ["#270D08", "#5D1050"],
      },
    ],
  };

  const fetchPost = () => {
    const api = {
      method: "get",
      url: "https://services2.arcgis.com/y20RuA5nmE8htWdM/ArcGIS/rest/services/service_d11617ca0c574916a61ed0717ef43960/FeatureServer/0/query?where=1%3D1&objectIds=&time=&geometry=&geometryType=esriGeometryEnvelope&inSR=&spatialRel=esriSpatialRelIntersects&resultType=none&distance=0.0&units=esriSRUnit_Meter&relationParam=&returnGeodetic=false&outFields=*&returnGeometry=true&featureEncoding=esriDefault&multipatchOption=xyFootprint&maxAllowableOffset=&geometryPrecision=&outSR=&defaultSR=&datumTransformation=&applyVCSProjection=false&returnIdsOnly=false&returnUniqueIdsOnly=false&returnCountOnly=false&returnExtentOnly=false&returnQueryGeometry=false&returnDistinctValues=false&cacheHint=false&orderByFields=&groupByFieldsForStatistics=&outStatistics=&having=&resultOffset=&resultRecordCount=&returnZ=false&returnM=false&returnExceededLimitFeatures=true&quantizationParameters=&sqlFormat=none&f=json",
    };
    axios(api)
      .then((res) => {
        setFeature(res.data.features);
        console.log("__________", res.data.features, "++++++++++++++++++");
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <>
      <div>
        <div className="bg-gray-100">
          <div className="m-4 flex-auto">
            <div className="flex items-center w-full gap-8 px-2 mx-2 mt-3 border border-gray-200">
              <div className="w-96">
                <p className="text-xl text-gray-600">Claim Table</p>
              </div>
              <div className="flex ml-14">
