                  <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
                    <tr>
                      <th scope="col" className="px-6 py-3">
                        Reg Number
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Serial Number
                      </th>
                      <th scope="col" className="px-6 py-3">
                        School
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Owner Name
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Phone Number
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Email
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Problem
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Special Other
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Comments
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Date
                      </th>
                      <th scope="col" className="px-6 py-3">
                        Status
                      </th>
                    </tr>
                  </thead>
                  {/* <tbody>
                    {features
                      .filter((feature) =>
                        (feature.attributes.numero_colis + "").startsWith(
                          searchText
